import React from "react";
import { connect } from "react-redux";
import { useParams } from "react-router";

const Detail = () => {
  const id = useParams();
  console.log(id);
  return (
    <div>
      <h1>Detail</h1>
    </div>
  );
};

function mapStateToProps(state, ownProps) {
  console.log(ownProps);
  return { toDos: state };
}

export default connect(mapStateToProps)(Detail);
